import Link from 'next/link';

const linkStyle = {
    marginRight: 15
};

const Header = () => (
    <header>
        <nav>
            <Link href="/"><a><img src="/images/xl-axiata-logo.svg" /></a></Link>
        </nav>
        <nav>
            <ul>
                <li>
                    <Link href="/">
                        <a style={linkStyle}>Home</a>
                    </Link>
                </li>
                <li>

                    <Link href="/rsvp-scanner">
                        <a style={linkStyle}>RSVP Scanner</a>
                    </Link>
                </li>
            </ul>
        </nav>

    </header>
);

export default Header;
